  Route,
  Switch,
  useLocation,
  useHistory,
  useParams,
  useRouteMatch,
} from "react-router-dom";

function Home() {
  return (
<div>


    <a href="#" class="btn btn-secondary">Create Deck</a>
    <div class="card">
      
  <div class="card-header">
    Featured
  </div>
  <div class="card-body">
    <h5 class="card-title">Rendering in React</h5>
    <h5 class="card-title">3 cards</h5>
    <p class="card-text">React's component structure allows for quickly buildign a complex web application that relies on DOM manipulation.</p>
    <a href="#" class="btn btn-secondary">View</a>
    <a href="#" class="btn btn-primary">Study</a>
    <a href="#" class="btn btn-danger">Trash Can Icon</a>
    <button type="button" class="btn btn-outline-primary">Primary</button>
    
    
  </div>
</div>
</div>
  )
  
  
  
  
  
}

export default Home;
